import {  Slider } from "../../components";
import { Section ,NewRelease } from "../../components";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";


const Home = () => {
  const { daily , chill ,artist, weekChart} = useSelector((state) => state.app);

  return (
    <div className="overflow-y-auto flex flex-col ">
      <Slider />
      <Section data = {chill}/>
      <NewRelease/>
      <Section data = {daily}/>
      <Section data = {artist}/>
      <div>
        {weekChart.length > 0 && weekChart?.map(item => (
          <Link to={item?.link.slice('.')[0]} key={item.link}>
            <img
            />
          </Link>
        ))}
      </div>
    </div>
  );
};

export default Home;
